  return ( te ? <Navigate to ="/mainstud" /> : <Fun/>)

  return (
    <div>Profile
      <p>{x.Reg}</p>
      <p>{x.Name}</p>
      <p>{x.Dept}</p>
      <p>{x.Email}</p>
      <p>{x.Password}</p>
      <p>{x.Gender}</p>
      <p>{x.State}</p>
    </div>
  )
}

export default Profile
